import React from 'react';
import { Document } from 'react-pdf';
import resume from "../../pdf/resume"

function Resume() {
    return (
        <div>
            <Document
                file={resume}
                onLoadSuccess={Resume}
            />
        </div>
    )
}

export default Resume;
